import { Menu } from 'semantic-ui-react'

export default class MenuExampleInverted extends Component {

  render() {
    const { activeItem } = this.state

    return (
      <Menu inverted>
         <Menu.Item name='Home'/>
      </Menu>
    )
  }
}
